import $ from "jquery";

function traeLibro(){
	let input_buscar = $( "input.input_buscar" ).val();
	// input_buscar.length >= 1 ? (
	// 	console.log( `GG: ${input_buscar}` ),
	// ) : (
	// 	"nada"
	// );
	input_buscar > 18 ? (
		alert("OK, puedes continuar."),
		location.assign("continue.html")
	) : (
		stop = true,
		alert("Disculpa, eres menor de edad!")
	);
	// console.log( `GG: ${input_buscar}` );
}

export {
	traeLibro
}
